import './LoginPage.css';
import logo from '../files/logo_main.png';
import {React} from 'react';

export const LoginPage = () => {

  return (
    <div class='columns'>
        <div className='row1'>
          
          <div className='item profile-image'>
            <img src={logo} alt='Find-a-Bull logo'/>
          </div>

          <div className='item profile-name'>
            <h2>Нэйм нэймович</h2>
          </div>

          <div className='item profile-contact'>
            <h2>Где услышать ваш анекдот<br/>Email nusheen@usf.edu<br/>Phone<br/>Git<br/>Discord<br/>Linkedin</h2>
          </div>
        </div>
        <div className='row2'>
          
        </div>
    </div>
  );
}
